import React, { useEffect, useState } from 'react';
import { getExpenses } from '../services/api';

function ExpenseList({ refresh }) {
  const [expenses, setExpenses] = useState([]);

  useEffect(() => {
    getExpenses().then(res => setExpenses(res.data));
  }, [refresh]);

  return (
    <table>
      <thead>
        <tr>
          <th>Date</th>
          <th>Category</th>
          <th>Description</th>
          <th>Amount</th>
        </tr>
      </thead>
      <tbody>
        {expenses.map(exp => (
          <tr key={exp.id}>
            <td>{exp.date}</td>
            <td>{exp.category}</td>
            <td>{exp.description}</td>
            <td>{exp.amount}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default ExpenseList;
